"""We needed to ensure that our model could distinguish sequences containing the true regulatory motif "CGACCGAACTCC" from those that do not. To create a balanced dataset, we generated a set of 50 random DNA sequences that explicitly do not contain this motif. This allowed us to have an equal representation of positive and negative examples. By ensuring the motif was absent in these sequences, we created a robust test for the model’s ability to accurately classify sequences based on the presence of the specific binding motif. These newly generated sequences, along with the original ones containing the motif, form the dataset used for training and evaluating our neural network."""

import numpy as np
import random

# Define the base characters
bases = ['A', 'C', 'G', 'T']

# Define the true regulatory motif
true_motif = "CGACCGAACTCC"
motif_length = len(true_motif)

# Generate random sequences that do not contain the motif
def generate_random_sequence(length, motif):
    while True:
        sequence = ''.join(random.choice(bases) for _ in range(length))
        if motif not in sequence:
            return sequence

# Generate sequences of the same length as your original sequences
length_of_sequences = len(sequences[0])  # Assuming all sequences have the same length
num_new_sequences = 50  # Same number of sequences as in the original set

# Generate new sequences
new_sequences = [generate_random_sequence(length_of_sequences, true_motif) for _ in range(num_new_sequences)]

# Combine original and new sequences
combined_sequences = sequences + new_sequences

# Save the combined sequences to 'formatted_sequences.txt'
with open('formatted_sequences.txt', 'w') as output_file:
    for i, seq in enumerate(combined_sequences, 1):
        output_file.write(f">{i}\n{seq}\n")

# Count the number of sequences generated
num_sequences = len(combined_sequences)
print(f"Number of sequences generated: {num_sequences}")

"""### **Prepare the data**

The next step involves preparing the data for input into a deep learning algorithm.

To convert each DNA sequence into a matrix format, we use one-hot encoding. This technique represents each base in a sequence as a 4-dimensional vector, with each dimension corresponding to a specific base.

We place a "1" in the dimension that matches the base present in the DNA sequence and "0"s in all other dimensions.

These 4-dimensional vectors are then concatenated along the sequence to create a matrix.

"""

import warnings
import numpy as np
from sklearn.preprocessing import OneHotEncoder

# Suppress all warnings
warnings.filterwarnings("ignore")

# Define the base characters and create a dictionary for indexing
bases = ['A', 'C', 'G', 'T']
base_to_index = {base: i for i, base in enumerate(bases)}

# Initialize the OneHotEncoder
one_hot_encoder = OneHotEncoder(categories=[range(len(bases))], sparse=False)

# Prepare the input features using combined_sequences
input_features = []

with warnings.catch_warnings(record=True) as w:
    warnings.simplefilter("always")
    for sequence in combined_sequences:  # Use combined_sequences here
        # Convert each base to its index
        integer_encoded = [base_to_index[base] for base in sequence]
        integer_encoded = np.array(integer_encoded).reshape(-1, 1)

        # One-hot encode the sequence
        one_hot_encoded = one_hot_encoder.fit_transform(integer_encoded)

        # Append to the list
        input_features.append(one_hot_encoded)

# Convert the list of arrays into a single numpy array
input_features = np.stack(input_features)

# Print an example
np.set_printoptions(threshold=40)
print("Example sequence\n-----------------------")
print('DNA Sequence #1:\n', combined_sequences[0][:10], '...', combined_sequences[0][-10:])
print('One-hot encoding of Sequence #1:\n', input_features[0].T)

"""### **Prepare labels for Training**

To prepare labels for training a neural network, we need to first generate and then encode them.

For our dataset of 50 DNA sequences, we generated labels for our DNA sequences based on the presence of a known regulatory motif, "CGACCGAACTCC."

Sequences containing this motif were labeled as 1, while those without it were labeled as 0. This labeling approach ensures that the dataset reflects biologically meaningful features, enabling the neural network to learn and identify this specific motif during the training process.

The labels were then one-hot encoded, converting them into a suitable format for binary classification tasks within the neural network model.

For instance, if we only have two possible classes (0 and 1), each label is represented as a vector with a "1" in the position corresponding to the class and "0"s elsewhere. This encoding makes it easier for the neural network to process and learn from the labels during training.
"""

import numpy as np
from sklearn.preprocessing import OneHotEncoder

# Define the true regulatory motif
true_motif = "CGACCGAACTCC"

# Generate labels based on the presence of the true motif in the combined sequences
labels = np.array([1 if true_motif in seq else 0 for seq in combined_sequences])

# Print the generated labels
print('Labels:\n', labels)

# One-hot encode the labels
one_hot_encoder = OneHotEncoder(categories='auto')
labels = labels.reshape(-1, 1)  # Reshape for the encoder
input_labels = one_hot_encoder.fit_transform(labels).toarray()

# Print the one-hot encoded labels
print('One-hot encoded labels:\n', input_labels)

"""To split our data into training and test sets, we use the `train_test_split` function from the `sklearn.model_selection` module. This function helps us partition our dataset so that we can evaluate our model's performance on unseen data. Here’s how it works:

1. **Input Data**: We have two sets of data: `input_features`, which contains our one-hot encoded DNA sequences, and `input_labels`, which includes the corresponding one-hot encoded labels indicating whether a protein binds to each sequence.

2. **Splitting**: We use `train_test_split` to divide our data into two subsets:
   - `train_features` and `train_labels`: These are used for training the model. We use a portion of the data to fit the model and adjust its parameters.
   - `test_features` and `test_labels`: These are kept aside and used to evaluate the model's performance after training. This helps us gauge how well our model generalizes to new, unseen data.

3. **Parameters**:
   - `test_size=0.25`: This specifies that 25% of the data will be reserved for testing, while the remaining 75% will be used for training.
   - `random_state=42`: This ensures reproducibility of the split. Setting a random seed allows us to obtain the same split each time we run the code.

"""

from sklearn.model_selection import train_test_split

# Split the data into training and test sets
train_features, test_features, train_labels, test_labels = train_test_split(
    input_features, input_labels, test_size=0.25, random_state=42
)

"""## **Summary**

In the first part of the article, we emphasize the importance of data curation and encoding. Proper data preparation is essential for neural networks, as these models rely on numerical inputs to learn patterns. One-hot encoding is particularly beneficial as it converts categorical data into a format that neural networks can process effectively, thus improving the model's ability to detect complex patterns in DNA sequences. In summary, the use of one-hot encoding enhances the performance and accuracy of neural networks in identifying transcription-factor binding sites, contributing to more effective functional genomics research.

#### **2. Select the Architecture and Train**

In the second part of this article, we shift our focus to the neural network architecture used for training the model. Specifically, we employ a 1D convolutional neural network (CNN), a popular choice in deep learning for functional genomics. CNNs are particularly effective because they learn to recognize patterns that are invariant across the input sequence. In our dataset, these patterns correspond to motifs within DNA sequences, and the CNN can combine these motifs to identify larger structures, such as transcription factor binding sites.

![alt text](https://github.com/abidlabs/deep-learning-genomics-primer/blob/master/Screenshot%20from%202018-08-01%2020-31-49.png?raw=true)

For this model, we use Keras, a deep learning library integrated into TensorFlow. Keras simplifies the process of constructing neural networks by allowing us to define the types of layers and their dimensions. The architecture of our CNN consists of the following layers:

Conv1D: A convolutional layer with 32 filters, each spanning 12 bases, designed to scan the input sequence for specific motifs.

MaxPooling1D: This layer follows the convolution to down-sample the output from each of the 32 filters. Although optional, pooling is a standard technique for reducing the dimensionality of the data and retaining the most important features.

Flatten: The output from the max pooling layer is flattened, creating a linear vector that combines the results of the convolution and pooling processes across all filters.

Dense: The first dense layer reduces the dimensionality of the flattened vector to 16 units, while the second dense layer compresses this further to produce the final output, representing the binary classification (0 or 1).

To gain a deeper understanding of the architecture, we use model.summary(), which provides details on the dimensionality and number of parameters in each layer. This structured approach allows us to build a model capable of recognizing complex patterns in DNA sequences, thereby advancing our ability to identify transcription factor binding sites.
"""

from tensorflow.keras.layers import Conv1D, Dense, MaxPooling1D, Flatten
from tensorflow.keras.models import Sequential

# Define the model architecture
model = Sequential()
model.add(Conv1D(filters=32, kernel_size=12, input_shape=(train_features.shape[1], 4)))
model.add(MaxPooling1D(pool_size=4))
model.add(Flatten())
model.add(Dense(16, activation='relu'))
model.add(Dense(1, activation='sigmoid'))  # Changed to 1 output with sigmoid activation

# Compile the model
model.compile(loss='binary_crossentropy', optimizer='adam', metrics=['binary_accuracy'])
model.summary()

"""With the data and architecture in place, we can proceed to train the neural network. To monitor the model’s performance, we’ll split the training data further into a training subset and a validation subset. Training will occur exclusively on the reduced training set, while we’ll track the loss for both the training and validation sets. When the validation loss stops improving or starts to worsen, it indicates that the model has reached convergence and further training could lead to overfitting. At that point, training should be stopped."""

# Train the model
history = model.fit(train_features, train_labels, epochs=50, verbose=0, validation_split=0.25)

# Plot the training and validation loss
plt.figure()
plt.plot(history.history['loss'])
plt.plot(history.history['val_loss'])
plt.title('Model Loss')
plt.ylabel('Loss')
plt.xlabel('Epoch')
plt.legend(['Train', 'Validation'])
plt.show()

"""In a similar manner, we can visualize the neural network's accuracy on the binary classification task. In this case, we use binary accuracy as our metric, which measures the percentage of predictions that correctly match the actual labels or response variables.

"""

plt.figure()
plt.plot(history.history['binary_accuracy'])
plt.plot(history.history['val_binary_accuracy'])
plt.title('model accuracy')
plt.ylabel('accuracy')
plt.xlabel('epoch')
plt.legend(['train', 'validation'])
plt.show()

