from sklearn.metrics import confusion_matrix
import itertools
import numpy as np
import matplotlib.pyplot as plt
from matplotlib.colors import LinearSegmentedColormap

# Custom colormap: blending blue and green
colors = [(0, 0, 1), (0, 1, 0)]  # Blue -> Green
n_bins = 100  # Use 100 color levels
cmap_name = 'blue_green'
cm_bl_gr = LinearSegmentedColormap.from_list(cmap_name, colors, N=n_bins)

# Generate the confusion matrix
predicted_labels = model.predict(np.stack(test_features))
cm = confusion_matrix(np.argmax(test_labels, axis=1),
                      np.argmax(predicted_labels, axis=1))
print('Confusion matrix:\n', cm)

# Normalize the confusion matrix
cm = cm.astype('float') / cm.sum(axis=1)[:, np.newaxis]

# Plot the confusion matrix
plt.imshow(cm, cmap=cm_bl_gr)
plt.title('Normalized confusion matrix')
plt.colorbar()
plt.xlabel('True label')
plt.ylabel('Predicted label')
plt.xticks([0, 1])
plt.yticks([0, 1])
plt.grid(False)

# Add text annotations
for i, j in itertools.product(range(cm.shape[0]), range(cm.shape[1])):
    plt.text(j, i, format(cm[i, j], '.2f'),
             horizontalalignment='center',
             color='white' if cm[i, j] > 0.5 else 'black')

plt.show()

"""#### **Interpret**

The results so far suggest that the neural network is quite effective in distinguishing sequences that bind the protein from those that do not. However, understanding the rationale behind the network’s classification decisions can offer deeper insights. To achieve this, we can calculate a saliency map, which reflects the gradient of the model’s prediction with respect to each individual nucleotide.

Essentially, the saliency map demonstrates how small changes in the input nucleotide sequence affect the output response. Positive gradient values indicate that even a minor alteration to a nucleotide can influence the output. By visualizing these gradients for a specific input sequence, we can identify which nucleotides are crucial in forming the binding motif that the model is detecting.

![alt text](https://github.com/abidlabs/deep-learning-genomics-primer/blob/master/Screenshot%20from%202018-08-01%2020-32-31.png?raw=true)
"""

import numpy as np
import tensorflow as tf
import matplotlib.pyplot as plt

def compute_salient_bases(model, x):
    # Expand dimensions of x to make it compatible with model input
    x = np.expand_dims(x, axis=0)
    x_tensor = tf.convert_to_tensor(x)

    with tf.GradientTape() as tape:
        tape.watch(x_tensor)
        predictions = model(x_tensor)

        # Use the correct prediction output for the loss calculation
        loss = predictions[:, 0]  # Since your model has a (1, 1) output shape

    gradients = tape.gradient(loss, x_tensor)[0]
    sal = np.clip(np.sum(np.multiply(gradients, x_tensor), axis=-1), a_min=0, a_max=None)
    return sal

sequence_index = 99
sal = compute_salient_bases(model, input_features[sequence_index])

# Flatten the saliency array
sal = sal.flatten()

# Check sal shape and values
print("Saliency shape:", sal.shape)
print("Saliency values:", sal)

# Plot the saliency map
plt.figure(figsize=[16,5])
barlist = plt.bar(np.arange(len(sal)), sal)
[barlist[i].set_color('C1') for i in range(min(len(sal), 5), min(len(sal), 17))]  # Adjust the coloring if needed
plt.xlabel('Bases')
plt.ylabel('Magnitude of saliency values')
plt.xticks(np.arange(len(sal)), list(combined_sequences[sequence_index]))  # Use combined_sequences here
plt.title('Saliency map for bases in one of the positive sequences'
          ' (green indicates the actual bases in motif)');
plt.show()

"""The saliency map above highlights the importance of each base in the selected DNA sequence for predicting whether the sequence contains the regulatory motif "CGACCGAACTCC." In this plot, higher saliency values indicate bases that contribute more significantly to the model's prediction.

As observed, the bases within the region marked in orange correspond to the actual motif embedded in the positive sequences. These bases exhibit higher saliency values, suggesting that the neural network has correctly identified them as crucial for determining the presence of the motif. This aligns with the intended design of our experiment, where this specific motif is the key feature the model should learn to recognize.

However, it's important to note that some bases outside the motif region also show non-zero saliency values. This is a common occurrence with gradient-based saliency map methods, as they are not always perfect and may highlight other regions with some influence on the prediction. More advanced interpretation techniques, such as integrated gradients or SHAP values, could provide more precise insights.

Moving forward, we might consider experimenting with different neural network architectures to enhance the model's performance on the validation dataset. This could involve adjusting hyperparameters such as the number of convolutional layers, layer dimensionality, learning rate, and the number of training epochs. Conducting a hyperparameter search or tuning could help refine the model, potentially leading to clearer identification of the binding motif and more accurate classification of sequences.
"""